import React, { useContext } from 'react';
import Switch from 'react-switch';
import { ThemeContext } from 'styled-components';
import { Link } from 'react-router-dom';

import {
    ContainerProjects,
    SubContainerProjects,
    Divider,
    SubTitle,
    SubTitleColor,
    ContainerButtons,
    ButtonArrows,
    ButtonGit,
    Projects,
    Project,
    Image,
    ContainerTitle,
    TitleProject,
    Description,
    Tools,
    AllProjects,
    TextButton
} from './styles';

import { FiExternalLink } from "react-icons/fi";

interface Props {
    toggleTheme(): void;
}

const Certificates: React.FC<Props> = ({ toggleTheme }) => {
    const { colors, title } = useContext(ThemeContext);

    const certificatesImages = [
        {
            id: 1,
            img: './certificates/01fabricadeapps.png'
        },
        {
            id: 2,
            img: './certificates/02.png'
        }
    ]

    return (
        <ContainerProjects>
            <SubContainerProjects>
                <Divider />
                <SubTitle>
                    Meus
                    <SubTitleColor> certificados</SubTitleColor>
                </SubTitle>
            </SubContainerProjects>

            <Projects>
                {certificatesImages.map((item) => {
                    const { id, img } = item;
                    return (
                        <Project key={id}>
                            <Image src={img} />
                        </Project>
                    )
                })}
            </Projects>
        </ContainerProjects>
    );
}

export default Certificates;
